    return (
        <>
            <section className="Button">
                <h1>Say Hello to ReactJS</h1>
                <p>You will learn how to use<br />the most popular frontend library,<br />and become a super Ninja developer.</p>
                <button>Awesome</button>
            </section>
        </>
    )
}

export default Button
